import {Navbar, Container, Row, Col } from "react-bootstrap";
import TopInput from './TopInput'
import TopSubject from './TopSubject'
export default function Footer() {
  return (
    <Navbar  sticky="top">
      <Container fluid>
        <Row>
          <Col className="bg-warning" xs={3}>
            <TopSubject />
          </Col>
          <Col className="bg-dark" xs={9}>
            <TopInput />
          </Col>
        </Row>
      </Container>
    </Navbar>
  );
}
